import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import './Animation.css';
const Animation = () => {
  const [stage, setStage] = useState(0);

  useEffect(() => {
    const timer = setTimeout(() => {
      if (stage < 5) {
        setStage(stage + 1);
      } else {
        setStage(0);
      }
    }, 5000);

    return () => clearTimeout(timer);
  }, [stage]);

  const skyColor = stage >= 2 ? "#87CEEB" : "#4A4A4A";
  const groundColor = stage >= 2 ? "#8B4513" : "#1A1A1A";

  return (
    <div className="animation-container">
      <svg viewBox="0 0 1000 600" className="w-full h-full">
        {/* Sky and Ground */}
        <motion.rect width="1000" height="400" fill={skyColor} animate={{ fill: skyColor }} />
        <motion.rect y="400" width="1000" height="200" fill={groundColor} animate={{ fill: groundColor }} />

        {/* Sun/Moon */}
        <motion.circle
          cx="900"
          cy="100"
          r="50"
          fill={stage >= 2 ? "#FFD700" : "#FFFFFF"}
          animate={{
            fill: stage >= 2 ? "#FFD700" : "#FFFFFF",
            cx: stage >= 2 ? 900 : 100,
          }}
        />

        {/* Chaotic construction site */}
        <AnimatePresence>
          {stage < 2 && (
            <motion.g
              initial={{ opacity: 1 }}
              exit={{ opacity: 0 }}
              transition={{ duration: 1 }}
            >
              <rect x="200" y="300" width="600" height="200" fill="#808080" />
              <polygon points="200,300 500,100 800,300" fill="#A9A9A9" />
              {/* Scattered materials */}
              <rect x="300" y="450" width="50" height="50" fill="#8B4513" />
              <rect x="600" y="400" width="40" height="40" fill="#D2691E" />
              <circle cx="400" cy="500" r="30" fill="#C0C0C0" />
            </motion.g>
          )}
        </AnimatePresence>

        {/* Vyvsai AI Entry */}
        <AnimatePresence>
          {stage === 1 && (
            <motion.g
              initial={{ scale: 0, opacity: 0 }}
              animate={{ scale: 1, opacity: 1 }}
              exit={{ scale: 0, opacity: 0 }}
              transition={{ duration: 1 }}
            >
              <text x="500" y="300" fontSize="50" textAnchor="middle" fill="#FFFFFF">
                Vyvsai AI
              </text>
            </motion.g>
          )}
        </AnimatePresence>

        {/* Additional Components */}
        <text x="175" y="110" textAnchor="middle" fontSize="12">Highway Project</text>

        {/* Bid Prediction */}
        <rect x="700" y="50" width="200" height="100" rx="10" fill="#FFFFFF" stroke="#000000" />
        <text x="800" y="80" textAnchor="middle" fontSize="14" fontWeight="bold">Bid Prediction</text>
        <text x="800" y="110" textAnchor="middle" fontSize="20" fill="#4CAF50">$10.5M</text>

        {/* Marketplace Integration */}
        <rect x="100" y="500" width="180" height="80" rx="10" fill="#FFFFFF" stroke="#000000" />
        <text x="190" y="535" textAnchor="middle" fontSize="14" fontWeight="bold">Marketplace</text>
        <text x="190" y="555" textAnchor="middle" fontSize="12">15 New Suppliers</text>

        {/* Fintech Solution */}
        <rect x="700" y="500" width="200" height="80" rx="10" fill="#FFFFFF" stroke="#000000" />
        <text x="800" y="535" textAnchor="middle" fontSize="14" fontWeight="bold">Instant Payments</text>
        <text x="800" y="555" textAnchor="middle" fontSize="12">Secure • Fast • Reliable</text>

        {/* Completed Project */}
        <AnimatePresence>
          {stage === 5 && (
            <motion.g
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 1 }}
            >
              <rect x="300" y="100" width="400" height="400" fill="#3F51B5" />
              <rect x="350" y="150" width="100" height="100" fill="#BBDEFB" />
              <rect x="550" y="150" width="100" height="100" fill="#BBDEFB" />
              <rect x="350" y="300" width="100" height="100" fill="#BBDEFB" />
              <rect x="550" y="300" width="100" height="100" fill="#BBDEFB" />
              <polygon points="300,100 500,20 700,100" fill="#303F9F" />

              {/* Vyvsai logo and tagline */}
              <text x="500" y="50" fontSize="30" textAnchor="middle" fill="#FFFFFF">
                Vyvsai
              </text>
              <text x="500" y="80" fontSize="20" textAnchor="middle" fill="#FFFFFF">
                Building the Future
              </text>
            </motion.g>
          )}
        </AnimatePresence>
      </svg>
    </div>
  );
};

export default Animation;
